1.Ролл в салате Айсберг с жареным лососем, сыром, огурцом, соусом Фьюжн, соусом Спайси и кранч луком;
2.Ролл в опаленном беконе с жареным лососем, сыром, томатом, соусом Спайси и рубленной фисташкой;
3.Ролл с опалённым морским окунём, сливочным сыром, жареным лососем, соусом Спайси, огурцом, зелёным луком, соусом Терияки и кунжутом;
4.Ролл в белом кунжуте с жареным лососем, сыром, томатом, огурцом, соусом Фьюжн и соусом Спайси;
5.Ролл с жареным лососем, соусом Спайси, сыром, огурцом, луком, соусом Терияки.
